        static void ExecutePE(byte[] rawBytes)
        {
            int SizeOfImage = GetSizeOfImage(rawBytes);
            int SizeOfHeaders = GetSizeOfHeaders(rawBytes);

            Logger.Log(LogLevel.Info, $"Size of Image: {SizeOfImage.ToString("X")}");
            Logger.Log(LogLevel.Info, $"Size of Headers: {SizeOfHeaders.ToString("X")}");

            // Allocating memory for the image
            IntPtr pImage = VirtualAlloc(IntPtr.Zero, (uint)SizeOfImage, 0x1000, 0x40);
            Logger.Log(LogLevel.Success, $"Allocated memory for {SizeOfImage.ToString("X")} at: 0x{pImage.ToString("X")}");

            #region Copying Headers
            // Copying the headers to the allocated memory
            Marshal.Copy(rawBytes, 0, pImage, SizeOfHeaders);
            Logger.Log(LogLevel.Success, $"Copied headers to memory");

            // Get DOS and NT Headers
            IMAGE_DOS_HEADER dosHeader = Marshal.PtrToStructure<IMAGE_DOS_HEADER>(pImage);
            IMAGE_NT_HEADERS64 ntHeaders = Marshal.PtrToStructure<IMAGE_NT_HEADERS64>(pImage + dosHeader.e_lfanew);
            #endregion

            #region Copying Sections
            // Copying sections to the allocated memory
            int c = ntHeaders.FileHeader.NumberOfSections;
            IMAGE_SECTION_HEADER[] sectionHeaders = new IMAGE_SECTION_HEADER[c];
            Logger.Log(LogLevel.Info, $"Number of sections: {c}");

            // Getting debug info for sections 
            for (int i = 0; i < c; i++)
            {
                sectionHeaders[i] = Marshal.PtrToStructure<IMAGE_SECTION_HEADER>(pImage + dosHeader.e_lfanew + Marshal.SizeOf<IMAGE_NT_HEADERS64>() + (Marshal.SizeOf<IMAGE_SECTION_HEADER>() * i));
                Logger.Log(LogLevel.Info, $"Section {i} - {new string(sectionHeaders[i].Name)}");
                //Logger.Log(LogLevel.Debug, $"\tPointer to Raw Data: {sectionHeaders[i].PointerToRawData.ToString("X")}");
                //Logger.Log(LogLevel.Debug, $"\tRaw Size: {sectionHeaders[i].SizeOfRawData.ToString("X")}");
                //Logger.Log(LogLevel.Debug, $"\tVirtual Address: {sectionHeaders[i].VirtualAddress.ToString("X")}");
                //Logger.Log(LogLevel.Debug, $"\tVirtual Size: {sectionHeaders[i].VirtualSize.ToString("X")}");  
            }

            // Copying sections to the allocated memory
            for (int i = 0; i < c; i++)
            {
                Logger.Log(LogLevel.Success, $"Copying section {i} ({new string(sectionHeaders[i].Name)}) to memory at: 0x{(pImage + (int)sectionHeaders[i].VirtualAddress).ToString("X")}");
                byte[] sectionBytes = new byte[sectionHeaders[i].SizeOfRawData];
                Array.Copy(rawBytes, sectionHeaders[i].PointerToRawData, sectionBytes, 0, sectionHeaders[i].SizeOfRawData);
                Marshal.Copy(sectionBytes, 0, pImage + (int)sectionHeaders[i].VirtualAddress, (int)sectionHeaders[i].SizeOfRawData);
            }
            #endregion

            #region Fixing Imports
            // Get current loaded modules
            Logger.Log(LogLevel.Info, $"Current loaded modules:");
            ProcessModuleCollection modules = Process.GetCurrentProcess().Modules;
            foreach (ProcessModule module in modules)
            {
                //Logger.Log(LogLevel.Debug, $"Module: {module.ModuleName} - 0x{module.BaseAddress.ToString("X")}");
            }
            // Fixing the imports 
            Logger.Log(LogLevel.Info, $"Loading dependency:");
            int ImportTableEntryVirtualAddress = (int)ntHeaders.OptionalHeader.ImportTable.VirtualAddress;
            IMAGE_IMPORT_DESCRIPTOR ImportTableEntry = Marshal.PtrToStructure<IMAGE_IMPORT_DESCRIPTOR>(pImage + ImportTableEntryVirtualAddress);

            while (ImportTableEntry.Name != 0)
            {
                // Getting all DLL names in import tables
                string DLLName = Marshal.PtrToStringAnsi(pImage + (int)ImportTableEntry.Name);
                Logger.Log(LogLevel.Info, $"DLL Name: {DLLName}");
                IntPtr DLLHandle = LoadLibrary(DLLName);
                if (DLLHandle == IntPtr.Zero)
                {
                    //Logger.Log(LogLevel.Warning, $"Failed to load DLL: {DLLName}. Last Error: 0x{GetLastError().ToString("X")}");
                    return;
                }
                //Logger.Log(LogLevel.Debug, $"DLL loaded! Handle at: 0x{DLLHandle.ToString("X")}");

                // Getting all functions in DLL
                IntPtr OriginalFirstThunk = pImage + (int)ImportTableEntry.OriginalFirstThunk;
                IntPtr FirstThunk = pImage + (int)ImportTableEntry.FirstThunk;

                IMAGE_THUNK_DATA OriginalFirstThunkEntry = Marshal.PtrToStructure<IMAGE_THUNK_DATA>((IntPtr)OriginalFirstThunk);

                while (OriginalFirstThunkEntry.Function != IntPtr.Zero)
                {
                    try
                    {
                        string FunctionName = Marshal.PtrToStringAnsi(pImage + (int)OriginalFirstThunkEntry.Function + 2);
                        //Logger.Log(LogLevel.Debug, $"\tFunction name: {FunctionName}");
                        IntPtr pRealFunction = GetProcAddress(DLLHandle, FunctionName);
                        if (pRealFunction == IntPtr.Zero)
                        {
                            //Logger.Log(LogLevel.Warning, $"Unable to find procedure {DLLName}!{FunctionName}");
                        }
                        //Logger.Log(LogLevel.Debug, $"\t\tPatching {DLLName}!{FunctionName} at: 0x{FirstThunk.ToString("X")}, to: 0x{pRealFunction.ToString("X")}");
                        byte[] FunctionBytes = BitConverter.GetBytes(pRealFunction.ToInt64());
                        Marshal.Copy(FunctionBytes, 0, FirstThunk, FunctionBytes.Length);
                        FirstThunk += 8;
                    }
                    catch
                    {
                        //Logger.Log(LogLevel.Error, $"\tFailed to get function name");
                    }

                    OriginalFirstThunk += Marshal.SizeOf<IMAGE_THUNK_DATA>();
                    OriginalFirstThunkEntry = Marshal.PtrToStructure<IMAGE_THUNK_DATA>(OriginalFirstThunk);
                }

                ImportTableEntryVirtualAddress += Marshal.SizeOf<IMAGE_IMPORT_DESCRIPTOR>();
                ImportTableEntry = Marshal.PtrToStructure<IMAGE_IMPORT_DESCRIPTOR>(pImage + ImportTableEntryVirtualAddress);
            }
            #endregion

            #region Fixing Base Relocations

            long delta = (long)pImage - (long)ntHeaders.OptionalHeader.ImageBase;
            Logger.Log(LogLevel.Info, "Modifying Memory Based On Relocation Table");
            Logger.Log(LogLevel.Info, $"Image Base: 0x{ntHeaders.OptionalHeader.ImageBase.ToString("X")}");
            Logger.Log(LogLevel.Info, $"Image Base (After Relocation): 0x{pImage.ToString("X")}");
            Logger.Log(LogLevel.Info, $"Delta: {delta.ToString("X")}");

            IntPtr RelocationTable = pImage + (int)ntHeaders.OptionalHeader.BaseRelocationTable.VirtualAddress;
            IMAGE_BASE_RELOCATION RelocationTableEntry = Marshal.PtrToStructure<IMAGE_BASE_RELOCATION>(RelocationTable);

            while (RelocationTableEntry.VirtualAdress != 0)
            {
                //Logger.Log(LogLevel.Debug, $"Page RVA: {RelocationTableEntry.VirtualAdress.ToString("X")}");
                //Logger.Log(LogLevel.Debug, $"Block Size: {RelocationTableEntry.SizeOfBlock.ToString("X")}");

                int NumberOfEntries = (int)((RelocationTableEntry.SizeOfBlock - 8) / 2);

                for (int i = 0; i < NumberOfEntries; i++)
                {
                    ushort Offset = Marshal.PtrToStructure<ushort>(RelocationTable + 8 + (i * 2));
                    ushort Type = (ushort)(Offset >> 12);
                    ushort OffsetFromPage = (ushort)(Offset & 0xFFF);
                    //Logger.Log(LogLevel.Debug, $"\tOffset: {Offset.ToString("X")}");
                    //Logger.Log(LogLevel.Debug, $"\tType: {Type.ToString("X")}");
                    //Logger.Log(LogLevel.Debug, $"\tOffsetFromPage: {OffsetFromPage.ToString("X")}");

                    IntPtr pRelocationEntry = pImage + (int)RelocationTableEntry.VirtualAdress;

                    if (Type == 0xA)
                    {
                        IntPtr pPatch = pImage + (int)RelocationTableEntry.VirtualAdress + OffsetFromPage;
                        //Logger.Log(LogLevel.Debug, $"Patching at: 0x{pPatch.ToString("X")}");
                        long OriginalValue = Marshal.ReadInt64(pPatch);
                        //Logger.Log(LogLevel.Success, $"\tOriginal Value: {OriginalValue.ToString("X")}");
                        long NewValue = OriginalValue + delta;
                        //Logger.Log(LogLevel.Success, $"\tNew Value: {NewValue.ToString("X")}");
                        Marshal.WriteInt64(pPatch, NewValue);
                    }
                }

                RelocationTable += (int)RelocationTableEntry.SizeOfBlock;
                RelocationTableEntry = Marshal.PtrToStructure<IMAGE_BASE_RELOCATION>(RelocationTable);
            }

            #endregion

            #region Execute Thread

            IntPtr StartThread = pImage + (int)ntHeaders.OptionalHeader.AddressOfEntryPoint;
            Logger.Log(LogLevel.Info, $"Starting thread at: 0x{StartThread.ToString("X")}");
            IntPtr ThreadHandle = CreateThread(IntPtr.Zero, 0, StartThread, IntPtr.Zero, 0, IntPtr.Zero);
            if (ThreadHandle == IntPtr.Zero)
            {
                Logger.Log(LogLevel.Error, "Unable to start thread!!");
            }
            else
            {
                Logger.Log(LogLevel.Success, $"Thread started at: 0x{ThreadHandle.ToString("X")}");
            }

            WaitForSingleObject(ThreadHandle, 0xFFFFFFFF);

            #endregion

            Console.ReadKey();
            VirtualFree(pImage);
        }

        static int GetSizeOfImage(byte[] bytes)
        {
            int SizeOfHeaders = 0;
            byte[] e_lfanew = new byte[4];
            Array.Copy(bytes, 0x3C, e_lfanew, 0, 4);

            int e_lfanew_int = BitConverter.ToInt32(e_lfanew, 0);
            byte[] SizeOfHeaders_bytes = new byte[4];
            Array.Copy(bytes, e_lfanew_int + 0x50, SizeOfHeaders_bytes, 0, 4);
            SizeOfHeaders = BitConverter.ToInt32(SizeOfHeaders_bytes, 0);
            return SizeOfHeaders;
        }
        static int GetSizeOfHeaders(byte[] bytes)
        {
            int SizeOfHeaders = 0;
            byte[] e_lfanew = new byte[4];
            Array.Copy(bytes, 0x3C, e_lfanew, 0, 4);

            int e_lfanew_int = BitConverter.ToInt32(e_lfanew, 0);
            byte[] SizeOfHeaders_bytes = new byte[4];
            Array.Copy(bytes, e_lfanew_int + 0x54, SizeOfHeaders_bytes, 0, 4);
            SizeOfHeaders = BitConverter.ToInt32(SizeOfHeaders_bytes, 0);
            return SizeOfHeaders;
        }
    }
